import React from 'react';
import { Link } from 'react-router-dom';
import { useForm } from 'react-hook-form';
import { yupResolver } from '@hookform/resolvers/yup';
import * as yup from 'yup';
import { toast, ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';




const schema = yup.object().shape({
  Email: yup.string().email('Invalid email format').required('The Email Is required'),
  password: yup.string().min(8, 'At least 8 char').matches(/[A-Z]/, 'Password must have at least one uppercase letter')
  .matches(/[a-z]/, 'Password must have at least one lowercase letter')
  .matches(/[!@#$%^&*(),.?":{}|<>]/, 'Password must have at least one special character')
  .required('The Password Is required'),
});

const Login = () => {
 

  const { register, handleSubmit, formState: { errors } } = useForm({
    resolver: yupResolver(schema),
  });

  const onSubmit = async (data) => {
    try {
      const response = await fetch('https://freelancers.runasp.net/Auth/Login', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(data),
      });
      if (response.ok) {
        toast.success('The login is successfull!');
      } else if (response.status === 409) {
        toast.error('Account with this email already exists. Please use another email.');
      } else {
        toast.error('Failed to login to your account. Please try again.');
      }
    } catch (error) {
      console.error('Error:', error);
      toast.error('An error occurred. Please try again.');
    }
  };

  return (
    <div className='flex flex-col items-center justify-center min-h-screen bg-gray-100'>
  <div className="bg-white shadow-md rounded-lg p-8 max-w-md w-full">
    <div className="header mb-4">
      <div className='flex justify-between items-center'>
        <span className='text-2xl font-bold text-blue-600'>Tech Titans</span>
        <Link to="/login" className='text-blue-500 hover:underline'>Login</Link>
      </div>

      <div className="mt-2 text-right">
        <Link to="/contact" className='text-blue-500 hover:underline'>Contact Us</Link>
      </div>
    </div>

    <div className="formContent">
     

      <div className='mainForm'>
        <h2 className='text-2xl font-semibold mb-4'>Login To Your Account</h2>
        <p className='text-gray-500 mb-6'>See what is going on with your business</p>

        <button className='w-full bg-red-500 text-white py-2 rounded-md flex items-center justify-center hover:bg-red-600 mb-4'>
          <img src="src/assets/search.png" alt="" className='w-6 h-6 mr-2'></img>
          Continue with Google
        </button>

        <p className='text-center text-gray-400 mb-4'>------------ or Sign Up with Email ------------</p>

        <form className="FormDesign space-y-4" onSubmit={handleSubmit(onSubmit)}>
          <div className="formList">
            <label className='block text-sm font-medium text-gray-700'>Email</label>
            <input 
              type="Email"  
              {...register("Email")} 
              placeholder="mail@abc.com" 
              className='mt-1 block w-full px-3 py-2 bg-gray-50 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500'
            />
            {errors.Email && <p className='text-red-500 text-xs mt-1'>{errors.Email.message}</p>}

            <label className='block text-sm font-medium text-gray-700'>Password</label>
            <input 
              type="password" 
              {...register('password')} 
              placeholder="***********" 
              className='mt-1 block w-full px-3 py-2 bg-gray-50 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500'
            />
            {errors.password && <p className='text-red-500 text-xs mt-1'>{errors.password.message}</p>}

            <div className='flex justify-between items-center mt-2'>
              <div className='flex items-center'>
                <input type='Checkbox' className='h-4 w-4 text-blue-600 focus:ring-blue-500 border-gray-300 rounded'></input>
                <label className='ml-2 text-sm text-gray-700'>Remember Me</label>
              </div>
              <Link to='/forgot' className='text-sm text-blue-500 hover:underline'>Forgot Password?</Link>
            </div>
          </div>

          <button className='w-full bg-blue-500 text-white py-2 rounded-md hover:bg-blue-600'>Login</button>
        </form>

        <div className='text-center mt-4'>
          <p className='text-gray-600'>Not Registered Yet? <Link to='/register' className='text-blue-500 hover:underline'>Create an account</Link></p>
        </div>
      </div>
    </div>
  </div>
</div>

  );
}

export default Login;
